    function bench_bn254_hash_to_curve(bytes32 domain, bytes memory message) public view returns (uint256) {
        uint256 startGas = gasleft();
        
        hashToPoint(domain, message);
        
        uint256 endGas = gasleft();

        return startGas - endGas;
    }

    

    // FLAG_CHANGE: new function to measure gas used by hash to curve
    // TODO differences from just calling verify proof
    function bench_bls_vrf_ver_ecp(
        bytes32 y,
        uint256[2] memory inp,
        uint256[4] memory pk, 
        uint256[2] memory sig
    ) public view returns (uint256) {
        uint256 startGas = gasleft();
        
        //this check is what separates bench_bls_vrf and bench_bls_sig
        require(y == keccak256(abi.encode(sig)));

        bool callSuccess;
        bool checkSuccess;

        (checkSuccess, callSuccess) = verifySingle(
            sig,
            pk,
            inp,
            PRECOMPILE_GAS_COST
        );

        require(
            callSuccess,
            "Verify : Incorrect Public key or Signature Points"
        );
        require(checkSuccess, "Verify : Incorrect Input Message");

        uint256 endGas = gasleft();
        return startGas - endGas;
    }

